button.11:
button {
	outline: none;
	display: flex;
	align-items: center;
	justify-items: center;
	background-color: #232329;
	color: #fff3e9;
	border-radius: 5px;
	border: 1px #454551 solid;
	padding: 10px;
	cursor: pointer;
	position: relative;
	transition: all 180ms;
	will-change: transform;
	overflow: visible;
}

button > * {
	z-index: 1;
	position: relative;
}

button:hover {
	background: linear-gradient(180deg, #2b2b31 0%, #232329 100%);
	border-color: #6b6b75;
	transform: translateY(-3px) scale(1.02);
}

button:active {
	border-color: #454551;
	transform: translateY(0px) scale(1.02);
}

button:hover::after {
	opacity: 1;
	transform: translate(-50%, -50%) scale(1.02);
}
